public class WebBrowser {
    private String homePage = "google.com";
    private String currentURL = "google.com";
    private ArrayList<String> history = new ArrayList<>();
    private ArrayList<String> bookmarks = new ArrayList<>();
    private ArrayList<String> backHistory = new ArrayList<>();
    private int COUNT = 0;

    /**
     * Goes to homepage.
     */
    public void homePage() {
        this.homePage = homePage;
        currentURL = homePage;
        history.add(homePage);
    }

    /**
     * Goes back to previous page.
     */
    public void back() {
        COUNT += 1;
        int index = backHistory.size() - 2;
        if (backHistory.size() <= 1) {

            System.out.println("error, cannot go back. Throw");
        } else if (index != 0) {
            String backString = backHistory.get(index);
            goTo(backString);


        }
    }

    /**
     * Goes forward to next page.
     */
    public void forward() {
        int index = backHistory.size() - COUNT;
        if (backHistory.size() == COUNT) {
            return;

        }
        String forwardString = backHistory.get(index - 1);
        goTo(forwardString);


    }

    /**
     * Go to a webpage.
     *
     * @param url to go to
     */
    public void goTo(String url) {
        currentURL = url;
        backHistory.add(currentURL);
        history.add(currentURL);
    }

    /**
     * Add a webpage as a bookmark.
     */
    public void addAsBookmark() {
        bookmarks.add(currentURL);
    }

    /**
     * Remove a bookmark.
     *
     * @param bookmark to remove
     */
    public void removeBookmark(String bookmark) {
        bookmarks.remove(currentURL);
    }

    public List<String> getBookmarks() {
        return bookmarks;
    }

    public void setHomePage(String homePage) {
        this.homePage = homePage;

    }


    /**
     * Get top 3 visited pages.
     *
     * @return a String that contains top three visited pages separated with a newline "\n"
     */
    public String getTop3VisitedPages() {
        ArrayList<String> top3 = new ArrayList<>();
        Set<String> distinct = new HashSet<>(history);
        for (String s : distinct) {
            if (Collections.frequency(history, s) == 1) {
                top3.add(s + " - " + Collections.frequency(history, s) + " visit");
            } else {
                top3.add(s + " - " + Collections.frequency(history, s) + " visits");
            }
        }
        return top3.get(0) + "\n" + top3.get(1) + "\n" + top3.get(2);
    }

    /**
     * Returns a list of all visited pages.
     *
     * Not to be confused with pages in your back-history.
     *
     * For example, if you visit "facebook.com" and hit back(),
     * then the whole history would be: ["google.com", "facebook.com", "google.com"]
     * @return list of all visited pages
     */
    public List<String> getHistory() {
        return history;
    }


    /**
     * Returns the active web page (string).
     *
     * @return active web page
     */
    public String getCurrentUrl() {

        return currentURL;
    }

    public static void main(String[] args) {
        WebBrowser simple = new WebBrowser(); // Create an object of MyClass
        simple.history.add("google.com");
        simple.backHistory.add("google.com");
        System.out.println(simple.getCurrentUrl());
        simple.setHomePage("neti.ee");
        simple.goTo("facebook.com");

        System.out.println(simple.getCurrentUrl());
        simple.goTo("google.com");
        System.out.println(simple.getCurrentUrl());
        simple.back();
        System.out.println(simple.getCurrentUrl());
        simple.addAsBookmark();

        simple.forward();
        System.out.println(simple.getCurrentUrl());
        simple.homePage();
        System.out.println(simple.getCurrentUrl());
        simple.goTo("yahoo.com");
        simple.addAsBookmark();
        System.out.println(simple.getBookmarks());
        System.out.println(simple.getHistory());

        System.out.println(simple.getTop3VisitedPages());


    }
}

