Veebibrauseri loomine Javas
###########################

Kaust Gitis: ``EX02WebBrowser``

Pakk Gitis: ``ee.taltech.iti0200.webbrowser``

Ülesandeks on programmeerida veebibrauseri URL-ide haldamise programm, mille käigus õpime kasutama erinevaid andmestruktuure Javas.

Sinu tehtud rakendus peab suutma igal ajahetkel tagastada URL-i kus sa hetkel viibid.
Mõtle sellest kui aadressiribast Chrome, Firefox jne brauserites.
Selle jaoks on loodud malli meetod ``getCurrentUrl()`` mis tagastab sõnena URL-i, mis on hetkel brauseris lahti.

Vaja on programmeerida kõik brauseritele omased tegevused nagu kodulehe nupp,
edasi, tagasi, lemmiklehtede lisamine ja vaatamine.

Kodulehe (*homepage*) algseks vaikeväärtuseks on "google.com".

Lisaks nendele on veel vaja programmeerida võimalus igal ajahetkel minna suvalisele URL-ile.
Selleks on loodud loodud malli meetod ``goTo(String url)``.

Programmi toimimise näited:

.. code-block::

    ...
    getCurrentUrl() - > "google.com"
    setHomePage("neti.ee")
    goTo("facebook.com")
    back()
    back()
    getHistory() - > [google.com, facebook.com, google.com]
    ...

    ...
    setHomePage("neti.ee")
    goTo("facebook.com")
    forward()
    forward()
    getHistory() - > [google.com, facebook.com]
    ...

    ...
    setHomePage("neti.ee")
    goTo("facebook.com")
    back()
    homePage()
    forward()
    browser.getHistory() - > [google.com, facebook.com, google.com, neti.ee]
    ...

    ...
    getCurrentUrl() - > "google.com"
    setHomePage("neti.ee")
    goTo("facebook.com")
    getCurrentUrl() - > "facebook.com"
    goTo("google.com")
    getCurrentUrl() - > "google.com"
    back()
    getCurrentUrl() - > "facebook.com"
    addAsBookmark()
    forward()
    getCurrentUrl() - > "google.com"
    homePage()
    getCurrentUrl() - > "neti.ee"
    addAsBookmark()
    getBookmarks() - > [facebook.com, neti.ee]
    getHistory() - > [google.com, facebook.com, google.com, facebook.com, google.com, neti.ee]
    ...


Nagu ka päris brauseris tuleb ka sinul salvestada kogu ajalugu külastatud lehtedest ja seda peab olema
võimalik vaadata igal ajahetkel läbi meetodi ``getHistory()``, mis tagastab listi URL-idest (sõne kujul).

Brauseris peab olema võimalik ka statistikat vaadata igal hetkel: ``getTop3VisitedPages()``,
mis tagastab sõne kujul top 3 külastatud lehte koos nende külastamise arvuga.
Sõne peab olema vormindatud nõnda et välja printides näeks ta välja selline:


.. code-block::

    taltech.ee - 5 visits
    facebook.com - 3 visits
    google.com - 1 visit

Kui mitut lehte on külastatud sama arv kordi, siis nende järjestus on sama nagu oli ajaloo (*history*) järjekord. Näiteks külastati peale avalehe "google.com" veel lehte "facebook.com", siis järjestus on järgmine:  

.. code-block::

    google.com - 1 visit
    taltech.ee - 1 visit


Kasuta ülesande lahendamiseks kõige sobivamaid andmestruktuure.

Kui sul tekib segadus kuidas mõni meetod peaks toimima siis vaata inspiratsiooniks, kuidas see toimib päris brauseris.

