package ee.taltech.iti0200.webbrowser;

import java.util.*;

import static java.util.stream.Collectors.toMap;

public class WebBrowser {
    private Deque<String> back = new ArrayDeque<>();
    private Deque<String> forward = new ArrayDeque<>();
    private String homePage = "google.com";
    private String active = homePage;
    private List<String> bookmarks = new ArrayList<>();
    private List<String> history = new ArrayList<>();
    private Map<String, Integer> statistics = new LinkedHashMap<>();

    public WebBrowser() {
        history.add(homePage);
    }

    /**
     * Goes to homepage.
     */
    public void homePage() {
        back.push(active);
        active = homePage;
        forward.clear();
        logHistory();
    }

    /**
     * Goes back to previous page.
     */
    public void back() {
        if (!back.isEmpty()) {
            forward.push(active);
            active = back.pop();
            logHistory();
        }
    }

    /**
     * Goes forward to next page.
     */
    public void forward() {
        if (!forward.isEmpty()) {
            back.push(active);
            active = forward.pop();
            logHistory();
        }
    }

    /**
     * Logs history.
     */
    private void logHistory() {
        history.add(active);
    }

    /**
     * Go to a webpage.
     *
     * @param webpage url to go to
     */
    public void goTo(String url) {
        if (url != null) {
            back.push(active);
            active = url;
            forward.clear();
            logHistory();
        }
    }

    /**
     * Add a webpage as a bookmark.
     */
    public void addAsBookmark() {
        if (!bookmarks.contains(active)) {
            bookmarks.add(active);
        }
    }

    /**
     * Remove a bookmark.
     *
     * @param bookmark to remove
     */
    public void removeBookmark(String bookmark) {
        bookmarks.remove(bookmark);
    }

    public List<String> getBookmarks() {
        return bookmarks;
    }

    public void setHomePage(String homePage) {
        this.homePage = homePage;
    }

    /**
     * Get top 3 visited pages.
     *
     * @return a String that contains top three visited pages separated with a newline "\n"
     */
    public String getTop3VisitedPages() {
        history.forEach(entry -> {
            if (statistics.containsKey(entry)) {
                statistics.put(entry, statistics.get(entry) + 1);
            } else {
                statistics.put(entry, 1);
            }
        });
        Map<String, Integer> sorted = statistics
                .entrySet()
                .stream()
                .sorted(Collections.reverseOrder(Map.Entry.comparingByValue()))
                .limit(3)
                .collect(toMap(Map.Entry::getKey, Map.Entry::getValue, (e1, e2) -> e2, LinkedHashMap::new));
        StringBuilder stringBuilder = new StringBuilder();
        for (Map.Entry<String, Integer> entry : sorted.entrySet()) {
            stringBuilder.append(entry.getKey());
            stringBuilder.append(" - ");
            stringBuilder.append(entry.getValue());
            if (entry.getValue() == 1) {
                stringBuilder.append(" visit");
            } else {
                stringBuilder.append(" visits");
            }
            stringBuilder.append("\n");
        }
        return stringBuilder.toString();
    }

    public List<String> getHistory() {
        return history;
    }

    public String getCurrentUrl() {
        return active;
    }
}

