        webBrowser = new WebBrowser();
    }

    @Test(timeOut = 1000)
    public void testHomeButtonWithNewHomePage() {
        webBrowser.setHomePage(TWITTER_URL);
        webBrowser.homePage();
        assertEquals(webBrowser.getCurrentUrl(), TWITTER_URL);
    }

    @Test(timeOut = 1000)
    public void testGoToUrl() {
        webBrowser.goTo(TWITTER_URL);
        assertEquals(webBrowser.getCurrentUrl(), TWITTER_URL);
    }

    @Test(timeOut = 1000)
    public void test2UrlThenBackOnce() {
        webBrowser.goTo(TWITTER_URL);
        webBrowser.goTo(FACEBOOK_URL);
        webBrowser.back();
        assertEquals(webBrowser.getCurrentUrl(), TWITTER_URL);
    }

