    public void test100Pages30Back() {
        for (int i = 1; i < 101; i++) {
            webBrowser.goTo(PAGE + i);
        }
        for (int i = 0; i < 30; i++) {
            webBrowser.back();
        }
        assertEquals(webBrowser.getCurrentUrl(), "page70");
    }

