    public void test2UrlThenBackOnceForwardOnce() {
        webBrowser.goTo(TWITTER_URL);
        webBrowser.goTo(FACEBOOK_URL);
        webBrowser.back();
        webBrowser.forward();
        assertEquals(webBrowser.getCurrentUrl(), FACEBOOK_URL);
    }

