        for (int i = 1; i < 101; i++) {
            webBrowser.goTo(PAGE + i);
        }
        for (int i = 0; i < 100; i++) {
            webBrowser.back();
        }
        for (int i = 0; i < 100; i++) {
            webBrowser.forward();
        }
        assertEquals(webBrowser.getCurrentUrl(), "page100");
    }

